8\u0434\u0442\u0430).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1865_%D0%B3%D0%BE%D0%B4\" title=\"1865 \u0433\u043e\u0434\">1865<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u0440\u0430\u0441\u0441\u043a\u0430\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BA_%D0%A2%D0%B2%D0%B5%D0%BD\" title=\"\u041c\u0430\u0440\u043a \u0422\u0432\u0435\u043d\">\u041c\u0430\u0440\u043a\u0430 \u0422\u0432\u0435\u043d\u0430<\/a> \u00ab\u0417\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u0430\u044f \u043f\u0440\u044b\u0433\u0430\u044e\u0449\u0430\u044f \u043b\u044f\u0433\u0443\u0448\u043a\u0430\u00bb \u043d\u0430\u043f\u0435\u0447\u0430\u0442\u0430\u043d \u0432 \u00abSaturday Press\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1868_%D0%B3%D0%BE%D0%B4\" title=\"1868 \u0433\u043e\u0434\">1868<\/a>&#160;\u2014 \u041f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BD%D0%B4%D0%B5%D0%BB%D0%B5%D0%B5%D0%B2,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0435\u043d\u0434\u0435\u043b\u0435\u0435\u0432, \u0414\u043c\u0438\u0442\u0440\u0438\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0414.&#160;\u0418.&#160;\u041c\u0435\u043d\u0434\u0435\u043b\u0435\u0435\u0432\u0430<\/a> \u043e\u0441\u043d\u043e\u0432\u044b\u0432\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE%D0%B5_%D1%84%D0%B8%D0%B7%D0%B8%D0%BA%D0%BE-%D1%85%D0%B8%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D0%BE%D0%B1%D1%89%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e\u0435 \u0444\u0438\u0437\u0438\u043a\u043e-\u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e\">\u0420\u0443\u0441\u0441\u043a\u043e\u0435 \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870_%D0%B3%D0%BE%D0%B4\" title=\"1870 \u0433\u043e\u0434\">1870<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u0430\u044f \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u0430\u044f \u043b\u0438\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D1%83%D0%B1%D0%B8%D0%BD%D0%B0%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D0%B0\" title=\"\u0413\u043e\u043b\u0443\u0431\u0438\u043d\u0430\u044f \u043f\u043e\u0447\u0442\u0430\">\u0433\u043e\u043b\u0443\u0431\u0438\u043d\u043e\u0439 \u043f\u043e\u0447\u0442\u044b<\/a> \u0441\u0432\u044f\u0437\u044b\u0432\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u0422\u0443\u0440 (\u0433\u043e\u0440\u043e\u0434)\">\u0422\u0443\u0440<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1873_%D0%B3%D0%BE%D0%B4\" title=\"1873 \u0433\u043e\u0434\">1873<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%83%D0%B7%D0%B5%D0%BD%D1%88%D1%82%D0%B5%D1%80%D0%BD,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%A4%D1%91%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0440\u0443\u0437\u0435\u043d\u0448\u0442\u0435\u0440\u043d, \u0418\u0432\u0430\u043d \u0424\u0451\u0434\u043e\u0440\u043e\u0432\u0438\u0447\">\u0418.&#160;\u0424.&#160;\u041a\u0440\u0443\u0437\u0435\u043d\u0448\u0442\u0435\u0440\u043d\u0443<\/a> (\u0441\u043a\u0443\u043b\u044c\u043f\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%80%D0%B5%D0%B4%D0%B5%D1%80,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0440\u0435\u0434\u0435\u0440, \u0418\u0432\u0430\u043d \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0418.&#160;\u041d.&#160;\u0428\u0440\u0435\u0434\u0435\u0440<\/a>) \u043d\u0430 \u043d\u0430\u0431\u0435\u0440\u0435\u0436\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2\" title=\"\u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0441\u043a\u0438\u0439 \u043e\u0441\u0442\u0440\u043e\u0432\">\u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0441\u043a\u043e\u0433\u043e \u043e\u0441\u0442\u0440\u043e\u0432\u0430<\/a> (\u043d\u044b\u043d\u0435 \u043d\u0430\u0431. \u041b\u0435\u0439\u0442\u0435\u043d\u0430\u043d\u0442\u0430 \u0428\u043c\u0438\u0434\u0442\u0430).<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1901_%D0%B3%D0%BE%D0%B4\" title=\"1901 \u0433\u043e\u0434\">1901<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%80%D0%BC%D0%B8%D0%BD%D0%B3%D0%B5%D0%BC\" title=\"\u0411\u0438\u0440\u043c\u0438\u043d\u0433\u0435\u043c\">\u0411\u0438\u0440\u043c\u0438\u043d\u0433\u0435\u043c\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044f<\/a>, \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u044f\u0442 \u0431\u0435\u0441\u043f\u043e\u0440\u044f\u0434\u043a\u0438, \u043a\u043e\u0433\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BB%D0%BE%D0%B9%D0%B4_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6,_%D0%94%D1%8D%D0%B2%D0%B8%D0%B4\" title=\"\u041b\u043b\u043e\u0439\u0434 \u0414\u0436\u043e\u0440\u0434\u0436, \u0414\u044d\u0432\u0438\u0434\">\u0414\u044d\u0432\u0438\u0434 \u041b\u043b\u043e\u0439\u0434 \u0414\u0436\u043e\u0440\u0434\u0436<\/a> \u043f\u044b\u0442\u0430\u0435\u0442\u0441\u044f \u043f\u0440\u043e\u0438\u0437\u043d\u0435\u0441\u0442\u0438 \u0440\u0435\u0447\u044c \u043e \u0432\u043e\u0439\u043d\u0435 \u0432 \u042e\u0436\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u0444\u0440\u0438\u043a\u0430\">\u0410\u0444\u0440\u0438\u043a\u0435<\/a>. \u041e\u043d \u043f\u043e\u043a\u0438\u0434\u0430\u0435\u0442 \u0440\u0430\u0442\u0443\u0448\u0443, \u043f\u0435\u0440\u0435\u043e\u0434\u0435\u0432\u0448\u0438\u0441\u044c \u0441\u0435\u0440\u0436\u0430\u043d\u0442\u043e\u043c \u043f\u043e\u043b\u0438\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%92%D1%82%D0%BE%D1%80%D0%BE%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_%D0%A5%D0%B5%D1%8F_%E2%80%94_%D0%9F%D0%B0%D1%83%D0%BD%D1%81%D1%84%D0%BE%D1%82%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0412\u0442\u043e\u0440\u043e\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u0425\u0435\u044f \u2014 \u041f\u0430\u0443\u043d\u0441\u0444\u043e\u0442\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0412\u0442\u043e\u0440\u043e\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u0425\u0435\u044f&#160;\u2014 \u041f\u0430\u0443\u043d\u0441\u0444\u043e\u0442\u0430<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0435\u0439<\/a>, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0421\u0428\u0410 \u043f\u043e\u043b\u0443\u0447\u0430\u044e\u0442 \u043f\u0440\u0430\u0432\u043e \u043d\u0430 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043a\u0430\u043d\u0430\u043b\u0430 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BD%D0%B0%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D1%88%D0%B5%D0%B5%D0%BA\" title=\"\u041f\u0430\u043d\u0430\u043c\u0441\u043a\u0438\u0439 \u043f\u0435\u0440\u0435\u0448\u0435\u0435\u043a\">\u041f\u0430\u043d\u0430\u043c\u0441\u043a\u043e\u043c \u043f\u0435\u0440\u0435\u0448\u0435\u0439\u043a\u0435<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u0417\u0430\u043a\u043b\u044e\u0447\u0430\u0435\u0442\u0441\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u043e-\u041f\u0430\u043d\u0430\u043c\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440, \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0430\u044e\u0442 \u0431\u0435\u0441\u0441\u0440\u043e\u0447\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e \u043d\u0430 \u043e\u043