ikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0432\u0438\u044f\">\u041b\u0430\u0442\u0432\u0438\u044f<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0430 \u043e \u0441\u0432\u043e\u0435\u0439 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438.<\/li><li>\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BC%D1%81%D0%BA\" title=\"\u041e\u043c\u0441\u043a\">\u041e\u043c\u0441\u043a\u0435<\/a>: \u043a\u0430\u0437\u0430\u0447\u044c\u0438 \u0447\u0430\u0441\u0442\u0438 \u041e\u043c\u0441\u043a\u043e\u0433\u043e \u0433\u0430\u0440\u043d\u0438\u0437\u043e\u043d\u0430 \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043b\u0438 \u0447\u043b\u0435\u043d\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\">\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 (\u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u0438)<\/a>, \u0421\u043e\u0432\u0435\u0442 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u0438 \u043f\u0435\u0440\u0435\u0434\u0430\u043b \u0432\u043b\u0430\u0441\u0442\u044c \u0430\u0434\u043c\u0438\u0440\u0430\u043b\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D