\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%BC%D1%8C%D0%B5%D1%80%D0%B0\" title=\"\u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430\">\u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430<\/a> \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0437\u0432\u0443\u043a\u043e\u0432\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D0%BB%D1%8C%D1%82%D1%84%D0%B8%D0%BB%D1%8C%D0%BC\" title=\"\u041c\u0443\u043b\u044c\u0442\u0444\u0438\u043b\u044c\u043c\">\u043c\u0443\u043b\u044c\u0442\u0444\u0438\u043b\u044c\u043c\u0430<\/a> \u00ab\u041f\u0430\u0440\u043e\u0445\u043e\u0434\u0438\u043a \u0412\u0438\u043b\u043b\u0438\u00bb (\u00abSteamboat Willie\u00bb) \u0441 \u043b\u044e\u0431\u0438\u043c\u044b\u043c \u0432\u0441\u0435\u043c\u0438 \u0433\u0435\u0440\u043e\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BA%D0%BA%D0%B8_%D0%9C%D0%B0%D1%83%D1%81\" title=\"\u041c\u0438\u043a\u043a\u0438 \u041c\u0430\u0443\u0441\">\u041c\u0438\u043a\u043a\u0438 \u041c\u0430\u0443\u0441\u043e\u043c<\/a>. \u0414\u043e \u044d\u0442\u043e\u0433\u043e \u041c\u0438\u043a\u043a\u0438 \u041c\u0430\u0443\u0441 \u043f\u043e\u044f\u0432\u043b\u044f\u043b\u0441\u044f \u0432 \u0434\u0432\u0443\u0445 \u043d\u0435\u043c\u044b\u0445 \u043c\u0443\u043b\u044c\u0442\u0444\u0438\u043b\u044c\u043c\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1936_%D0%B3%D0%BE%D0%B4\" title=\"1936 \u0433\u043e\u0434\">1936<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u044f<\/a> \u0437\u0430\u044f\u0432\u043b\u044f\u044e\u0442 \u043e \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u0438 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%BE_%D0%91%D0%B0%D0%B0%D0%BC%D0%BE%D0%BD%D0%B4%D0%B5,_%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D0%B8%D1%81%D0%BA%D0%BE\" class=\"mw-redirect\" title=\"\u0424\u0440\u0430\u043d\u043a\u043e \u0411\u0430\u0430\u043c\u043e\u043d\u0434\u0435, \u0424\u0440\u0430\u043d\u0441\u0438\u0441\u043a\u043e\">\u0424\u0440\u0430\u043d\u043a\u043e<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0440\u0430\u0441\u043a\u0440\u044b\u0442 \u0444\u0430\u0448\u0438\u0441\u0442\u0441\u043a\u0438\u0439 \u0437\u0430\u0433\u043e\u0432\u043e\u0440.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B4%D0%B6%D0%B0%D0%B9%D0%BD%D0%B0\" title=\"\u0420\u0435\u0434\u0436\u0430\u0439\u043d\u0430\">\u0420\u0435\u0434\u0436\u0430\u0439\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>. \u0420\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442<\/a> \u00abLockheed Electra 14\u00bb \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00abTrans Canada Airlines\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u041c\u0430\u0433\u043d\u0438\u0442\u043d\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%B8%D0%BD%D0%B0\" title=\"\u041c\u043e\u0440\u0441\u043a\u0430\u044f \u043c\u0438\u043d\u0430\">\u043c\u0438\u043d\u044b<\/a>, \u0440\u0430\u0441\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0435 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u043c\u0438 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u044b\u043c\u0438 \u043b\u043e\u0434\u043a\u0430\u043c\u0438 \u0432\u0434\u043e\u043b\u044c \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u044c\u044f, \u0441\u0442\u0430\u043d\u043e\u0432\u044f\u0442\u0441\u044f \u043f\u0440\u0438\u0447\u0438\u043d\u043e\u0439 \u0433\u0438\u0431\u0435\u043b\u0438 \u0441\u0443\u0434\u043e\u0432 \u0435\u0436\u0435\u043d\u0435\u0434\u0435\u043b\u044c\u043d\u043e \u043e\u0431\u0449\u0438\u043c \u0432\u043e\u0434\u043e\u0438\u0437\u043c\u0435\u0449\u0435\u043d\u0438\u0435\u043c 60 000 \u0442\u043e\u043d\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0410\u0444\u0440\u0438\u043a\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u0444\u0440\u0438\u043a\u0435<\/a> \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0435 \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u044f\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BE-%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_(1941)\" title=\"\u0421\u0435\u0432\u0435\u0440\u043e-\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f (1941)\">\u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044e \u00ab\u041a\u0440\u0435\u0441\u0442\u043e\u043d\u043e\u0441\u0435\u0446\u00bb<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\">\u0415\u0433\u0438\u043f\u0442\u0435<\/a>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0437\u0430\u0432\u0435\u0440\u0448\u0430\u0435\u0442\u0441\u044f \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u0438\u0435\u043c \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%B1%D1%80%D1%83%D0%BA\" title=\"\u0422\u043e\u0431\u0440\u0443\u043a\">\u0422\u043e\u0431\u0440\u0443\u043a<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0438\u0432\u0438\u044f\">\u041b\u0438\u0432\u0438\u0438<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/7_%D0%B4%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D1%8F\" title=\"7 \u0434\u0435\u043a\u0430\u0431\u0440\u044f\">7 \u0434\u0435\u043a\u0430\u0431\u0440\u044f<\/a>) \u0438 \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u043e\u043c \u0432 \u043d\u0430\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 (\u0437\u0430\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a> \u0433.).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0418\u0440\u0430\u043d\">\u0438\u0440\u0430\u043d\u0441\u043a\u043e\u0439<\/a> \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0438 \u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435, \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u043e\u0435 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0430\u043c\u0438. \u041f\u043e\u0441\u043b\u0430\u043d\u043d\u044b\u0435 \u043d\u0430 \u0435\u0433\u043e \u043f\u043e\u0434\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u044b \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B2%D0%B8%D0%BD\" title=\"\u041a\u0430\u0437\u0432\u0438\u043d\">\u041a\u0430\u0437\u0432\u0438\u043d<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%83%D0%B3%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u044f\">\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u0438<\/a> \u043f\u0430\u0440\u0442\u0438\u044f \u00ab\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u043e\u044e\u0437\u00bb \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BB%D0%B0%D0%B7%D0%B0%D1%80,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8%D1%83_%D0%B4%D0%B5\" class=\"mw-redirect\" title=\"\u0421\u0430\u043b\u0430\u0437\u0430\u0440, \u0410\u043d\u0442\u043e\u043d\u0438\u0443 \u0434\u0435\">\u0421\u0430\u043b\u0430\u0437\u0430\u0440\u0430<\/a> \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0435 \u0432\u044b\u0431\u043e\u0440\u044b, \u0431\u043e\u0439\u043a\u043e\u0442\u0438\u0440\u0443\u0435\u043c\u044b\u0435 \u043e\u043f\u043f\u043e\u0437\u0438\u0446\u0438\u0435\u0439.<\/li><li>\u041d\u0430 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f\">\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u0438<\/a> \u043f\u043e\u0431\u0435\u0434\u0438\u043b \u00ab\u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0444\u0440\u043e\u043d\u0442\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0434\u043e\u043c\u0438\u043d\u0438\u0440\u043e\u0432\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0433\u0430\u0440\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f\">\u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u044b<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B2%D0%B5%D0%BB%D0%BB%D0%BE\" title=\"\u0420\u0430\u0432\u0435\u043b\u043b\u043e\">\u0420\u0430\u0432\u0435\u043b\u043b\u043e<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u044f<\/a>. \u0412\u0440\u0435\u0437\u0430\u043b\u0441\u044f \u0432 \u0433\u043e\u0440\u0443 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 \u00abBristol 170 Freighter XI\u00bb \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00abTrafik-Turist-Transportflyg\u00bb. \u0418\u0437 24 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u043d\u0430\u0445\u043e\u0434\u0438\u0432\u0448\u0438\u0445\u0441\u044f \u043d\u0430 \u0431\u043e\u0440\u0442\u0443, 20 \u043f\u043e\u0433\u0438\u0431\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u041d\u0430 \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0438 \u041a\u043e\u043d\u0441\u0443\u043b\u044c\u0442\u0430\u0442\u0438\u0432\u043d\u043e\u0439 \u0430\u0441\u0441\u0430\u043c\u0431\u043b\u0435\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D1%8B\" title=\"\u0421\u043e\u0432\u0435\u0442 \u0415\u0432\u0440\u043e\u043f\u044b\">\u0421\u043e\u0432\u0435\u0442\u0430 \u0415\u0432\u0440\u043e\u043f\u044b<\/a> \u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%83%D0%BC%D0%B0%D0%BD,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80\" title=\"\u0428\u0443\u043c\u0430\u043d, \u0420\u043e\u0431\u0435\u0440\">\u0420\u043e\u0431\u0435\u0440 \u0428\u0443\u043c\u0430\u043d<\/a> \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0435\u0442 \u043f\u043b\u0430\u043d \u041f\u043b\u0435\u0432\u0435\u043d\u0430 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044f \u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u0438 \u0435\u