40\u0430\u043f\u043e\u0440\u0449\u0438\u043a\u043e\u0432<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%87%D0%BC%D0%B0%D0%BD\" title=\"\u041c\u0438\u0447\u043c\u0430\u043d\">\u043c\u0438\u0447\u043c\u0430\u043d\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1975_%D0%B3%D0%BE%D0%B4\" title=\"1975 \u0433\u043e\u0434\">1975<\/a>&#160;\u2014 \u041f\u0435\u0442\u0435\u043d \u0421\u0442\u0435\u0439\u0442, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B2%D0%B0%D1%82%D0%B5%D0%BC%D0%B0%D0%BB%D0%B0\" title=\"\u0413\u0432\u0430\u0442\u0435\u043c\u0430\u043b\u0430\">\u0413\u0432\u0430\u0442\u0435\u043c\u0430\u043b\u0430<\/a>. \u0420\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/McDonnell_Douglas\" title=\"McDonnell Douglas\">Douglas<\/a> DC-3 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 Aviateca.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1977_%D0%B3%D0%BE%D0%B4\" title=\"1977 \u0433\u043e\u0434\">1977<\/a><ul><li>\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%B4%D0%B0%D1%82,_%D0%90%D0%BD%D0%B2%D0%B0%D1%80\" title=\"\u0421\u0430\u0434\u0430\u0442, \u0410\u043d\u0432\u0430\u0440\">\u0410\u043d\u0432\u0430\u0440 \u0421\u0430\u0434\u0430\u0442<\/a> \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u043c \u0415\u0433\u0438\u043f\u0435\u0442\u0441\u043a\u0438\u043c \u043b\u0438\u0434\u0435\u0440\u043e\u043c, \u043f\u043e\u0441\u0435\u0442\u0438\u0432\u0448\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u044c<\/a> \u0438 \u043e\u0431\u0440\u0430\u0442\u0438\u0432\u0448\u0438\u043c\u0441\u044f \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BD%D0%B5%D1%81%D1%81%D0%B5%D1%82\" title=\"\u041a\u043d\u0435\u0441\u0441\u0435\u0442\">\u041a\u043d\u0435\u0441\u0441\u0435\u0442\u0443<\/a> (\u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0443).<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%8C%D1%8E%D1%81%D1%82%D0%BE%D0%BD\" title=\"\u0425\u044c\u044e\u0441\u0442\u043e\u043d\">\u0425\u044c\u044e\u0441\u0442\u043e\u043d\u0435<\/a>, \u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%85%D0%B0%D1%81\" title=\"\u0422\u0435\u0445\u0430\u0441\">\u0422\u0435\u0445\u0430\u0441<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>, \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u0430\u044f \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f \u0436\u0435\u043d\u0449\u0438\u043d (\u043f\u043e 21 \u043d\u043e\u044f\u0431\u0440\u044f).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A1%D0%A8%D0%90\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410\">\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D0%B3%D0%B0%D0%BD,_%D0%A0%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4\" title=\"\u0420\u0435\u0439\u0433\u0430\u043d, \u0420\u043e\u043d\u0430\u043b\u044c\u0434\">\u0420\u0435\u0439\u0433\u0430\u043d<\/a> \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u0435\u0442 \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u0442\u044c \u0440\u0430\u0437\u043c\u0435\u0449\u0435\u043d\u0438\u0435 \u043a\u0440\u044b\u043b\u0430\u0442\u044b\u0445 \u0440\u0430\u043a\u0435\u0442 \u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/MGM-31\" class=\"mw-redirect\" title=\"MGM-31\">\u041f\u0435\u0440\u0448\u0438\u043d\u0433\u043e\u0432<\/a>\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0\" title=\"\u0415\u0432\u0440\u043e\u043f\u0430\">\u0415\u0432\u0440\u043e\u043f\u0435<\/a> \u0432 \u0441\u043b\u0443\u0447\u0430\u0435, \u0435\u0441\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0434\u0435\u043c\u043e\u043d\u0442\u0438\u0440\u0443\u0435\u0442 \u0441\u0432\u043e\u0438 \u0440\u0430\u043a\u0435\u0442\u044b \u0441\u0440\u0435\u0434\u043d\u0435\u0439 \u0434\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438, \u043d\u0430\u0446\u0435\u043b\u0435\u043d\u043d\u044b\u0435 \u043d\u0430 \u0441\u0442\u0440\u0430\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%B0%D1%8F_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0\" title=\"\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0415\u0432\u0440\u043e\u043f\u0430\">\u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u0415\u0432\u0440\u043e\u043f\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1982_%D0%B3%D0%BE%D0%B4\" title=\"1982 \u0433\u043e\u0434\">1982<\/a>&#160;\u2014 \u041f\u0435\u0440\u0435\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0438 \u0432 \u043e\u0440\u0433\u0430\u043d\u0430\u0445. \u041e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0451\u043d \u043e\u0442 \u043e\u0431\u044f\u0437\u0430\u043d\u043d\u043e\u0441\u0442\u0435\u0439 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u0434\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A9%D1%91%D0%BB%D0%BE%D0%BA%D0%BE%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BD%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0429\u0451\u043b\u043e\u043a\u043e\u0432, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0410\u043d\u0438\u0441\u0438\u043c\u043e\u0432\u0438\u0447\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0429\u0435\u043b\u043e\u043a\u043e\u0432<\/a> (\u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>). \u041d\u0430 \u0435\u0433\u043e \u043c\u0435\u0441\u0442\u043e \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d \u0431\u044b\u0432\u0448\u0438\u0439 \u0434\u043e \u044d\u0442\u043e\u0433\u043e \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%B1%D0%B5%D0%B7%D0%BE%D0%BF%D0%B0%D1%81%D0%BD%D0%BE%D1%81%D1%82%D0%B8_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u041a\u043e\u043c\u0438\u0442\u0435\u0442 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0421\u0421\u0421\u0420\">\u041a\u0413\u0411<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D0%B4%D0%BE%D1%80%D1%87%D1%83%D0%BA,_%D0%92%D0%B8%D1%82%D0%B0%D0%BB%D0%B8%D0%B9_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0424\u0435\u0434\u043e\u0440\u0447\u0443\u043a, \u0412\u0438\u0442\u0430\u043b\u0438\u0439 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0412\u0438\u0442\u0430\u043b\u0438\u0439 \u0424\u0435\u0434\u043e\u0440\u0447\u0443\u043a<\/a>. \u041d\u043e\u0432\u044b\u043c \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u041a\u0413\u0411 \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%B1%D1%80%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0427\u0435\u0431\u0440\u0438\u043a\u043e\u0432, \u0412\u0438\u043a\u0442\u043e\u0440 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0412\u0438\u043a\u0442\u043e\u0440 \u0427\u0435\u0431\u0440\u0438\u043a\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1983_%D0%B3%D0%BE%D0%B4\" title=\"1983 \u0433\u043e\u0434\">1983<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%91%D0%B5%D0%B7%D0%BE%D0%BF%D0%B0%D1%81%D0%BD%D0%BE%D1%81%D1%82%D0%B8_%D0%9E%D0%9E%D0%9D\" title=\"\u0421\u043e\u0432\u0435\u0442 \u0411\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u041e\u041e\u041d\">\u0421\u043e\u0432\u0435\u0442 \u0411\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a> \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442 \u0440\u0435\u0437\u043e\u043b\u044e\u0446\u0438\u044e 541, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u0437\u0430\u043a\u043e\u043d\u043e\u0434\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u0441\u043e\u0432\u0435\u0442\u043e\u043c \u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%BF%D1%80_(%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2)\" title=\"\u041a\u0438\u043f\u0440 (\u043e\u0441\u0442\u0440\u043e\u0432)\">\u041a\u0438\u043f\u0440\u0430<\/a> \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438