org\/wiki\/1997_%D0%B3%D0%BE%D0%B4\" title=\"1997 \u0433\u043e\u0434\">1997<\/a>&#160;\u2014 \u0414\u0432\u0430 \u043f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0446\u0430, \u043b\u0438\u0432\u0438\u0435\u0446 \u0438 \u043d\u0435\u043c\u0435\u0446 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u043b\u0438 \u043f\u0435\u0440\u0435\u0434 \u0441\u0443\u0434\u043e\u043c \u043f\u043e \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044e \u0432 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0432\u0437\u0440\u044b\u0432\u0430 \u0432 \u043e\u0434\u043d\u043e\u043c \u0438\u0437 \u043d\u043e\u0447\u043d\u044b\u0445 \u043a\u043b\u0443\u0431\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0430<\/a>. \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0442\u0440\u0430\u0433\u0435\u0434\u0438\u0438, \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0435\u0434\u0448\u0435\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986 \u0433\u043e\u0434\u0443<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0434\u0432\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u0432\u043e\u0435\u043d\u043d\u043e\u0441\u043b\u0443\u0436\u0430\u0449\u0438\u0445 \u0438 \u043e\u0434\u0438\u043d \u0442\u0443\u0440\u043e\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000_%D0%B3%D0%BE%D0%B4\" title=\"2000 \u0433\u043e\u0434\">2000<\/a><ul><li>\u041c\u043e\u0440\u044f\u043a\u0438 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0442\u0430\u043d\u043a\u0435\u0440\u0430 \u00ab\u0412\u0435\u043d\u0442\u0441\u043f\u0438\u043b\u0441\u00bb \u0441\u043f\u0430\u0441\u043b\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%B8%D0%BD%D0%B3%D0%BE%D0%B2%D0%BE_%D0%BC%D0%BE%D1%80%D0%B5\" title=\"\u0411\